exports.tools=function(){
    $('#tools-flux').append('<div class="bem-Tools"></div>');
    //第一个
    $('.bem-Tools').append('<div id="toolA" style="height: 100%; width: 100%; position: absolute;"></div>');
    $('#toolA').append('<div style="height: 100%; width: 100%; position: absolute; top: 0px; left: 0px;" id="toolAcontent"><div><div></div></div><div id="w-rich-text-node-canvas"></div><div class="resize-hint" style="transform: translate(10px, 10px);"><div class="main"><div class="value text">0</div><div class="x text">x</div><div class="value text">0</div></div><div class="note text"></div></div></div></div>');
    //第二个 画布右侧的滚动条
    $('.bem-Tools').append('<div id="toolB"></div>');
    $('#toolB').append('<div class="kit-scrollbar with-arrows" style="width: 10px; position: absolute; top: 0px; right: -10px; height: 100%; pointer-events: all; overflow-y: scroll; overflow-x: hidden;"><div style="width: 1px; height: 478px;"></div></div>');
    //第三个 拖拽助手
    var handle='<div class="canvas-resize-handle"><div class="handle right-handle" style="right: -24px;"><div class="gutter-handle"></div></div><div class="handle left-handle"></div></div>';
    $('.bem-Tools').append(handle);
    //第四个 画布左侧的文字描述
    var $node1=$('<div></div>').css({
        float: 'left',
        margin: '1px 5px 0px 0px',
        padding: '3px 7px',
        borderRadius: '2px',
        backgroundColor: 'rgb(115, 115, 115)'
    }).text('默认 - 模型');
    var $node2=$('<div></div>').css({
        float: 'left',
        margin: '5px 0px 0px 4px'
    }).text('影响所有布局');

    var $canvastxt=$('<div id="canvastxt"></div>').css({
        position: 'absolute',
        left: '-200px',
        top: '160px',
        width: '355px',
        pointerEvents: 'none',
        transform: 'rotate(-90deg) translateZ(0px)',
        fontSize: '12px',
        lineHeight: 1,
        color: 'rgba(255, 255, 255, 0.9)',
        '-webkit-font-smoothing': 'antialiased'
    });
    $canvastxt.append($node1);
    $canvastxt.append($node2);
    $('.bem-Tools').append($canvastxt);
}